import React from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components'

const StyledLink = styled(Link)`
    color: black;
    text-decoration: none;
    margin-right: 10%;

`

const StyledDiv = styled.div`
    display: flex;
    width: 100%;
    border: 1px solid red;

`

const Nav = (props) => {
  return (
    <StyledDiv>
        <StyledLink to='/'>
            Home
        </StyledLink>
        <StyledLink className='navlink' to='/about'>
            About
        </StyledLink>
        <StyledLink className='navlink' to='/itinerary'>
            Itinerary
        </StyledLink>
        <StyledLink className='navlink' to='/faqs'>
            FAQs
        </StyledLink>
        <StyledLink className='navlink' to='/rsvp'>
            RSVP
        </StyledLink>
    </StyledDiv>
  );
};

export default Nav;
